column4:
The Dubois and Dubois equation is an equation to calculate the body surface area:
    {BSA (m^2)}=0.007184 \times {weight \mbox{ (kg)}}^{0.425} \times {height \mbox{ (cm)}}^{0.725}

or alternatively expressed:

    {BSA (m^2)}=\frac{{weight \mbox{ (kg)}}^{0.425} \times {height \mbox{ (cm)}}^{0.725}}{139.2} 

source: http://en.wikipedia.org/wiki/Body_surface_area

Du Bois & Du Bois,Arch Intern Med 1916, 17:863

