Implicit solvation (sometimes known as continuum solvation) is a method of representing solvent as a continuous medium instead of individual  solvent molecules most often used in molecular dynamics simulations and in other applications of molecular mechanics. The method is often applied to estimate free energy of solute-solvent interactions in structural and chemical processes, such as folding or conformational transitions of proteins, DNA, RNA, and polysaccharides, association of biological macromolecules with ligands, or transport of drugs across biological membranes.

The Generalized Born (GB) model is an approximation to the exact (linearized) Poisson-Boltzmann equation. It is based on modeling the protein as a sphere whose internal dielectric constant differs from the external solvent. The model has the following functional form:

    G_{s} = \frac{1}{8\pi}\left(\frac{1}{\epsilon_{0}}-\frac{1}{\epsilon}\right)\sum_{i,j}^{N}\frac{q_{i}q_{j}}{f_{GB}}

where

    f_{GB} = \sqrt{r_{ij}^{2} + a_{ij}^{2}e^{-D}}

and D = \left(\frac{r_{ij}}{2a_{ij}}\right)^{2}, a_{ij} = \sqrt{a_{i}a_{j}}

where  

source:  http://en.wikipedia.org/wiki/Implicit_solvation#Generalized_Born
[15] Still WC, Tempczyk A, Hawley RC, Hendrickson T (1990). "Semianalytical treatment of solvation for molecular mechanics and dynamics". J Am Chem Soc 112 (16): 6127
[16] Onufriev A, Bashford D, Case DA (2002). "Effective Born radii in the generalized Born approximation: The importance of being perfect". J Comp Chem 23 (14): 1297 1304.

