column4:
In physics and chemistry, specifically in NMR (nuclear magnetic resonance) or MRI (magnetic resonance imaging), or ESR (electron spin resonance) the Bloch equations are a set of macroscopic equations that are used to calculate the nuclear magnetization M = (Mx, My, Mz) as a function of time when relaxation times T1 and T2 are present. These are phenomenological equations that were introduced by Felix Bloch in 1946. [1] Sometimes they are called the equations of motion of nuclear magnetization. ...
Let M(t) = (Mx(t), My(t), Mz(t)) be the nuclear magnetization. Then the Bloch equations read:

    \frac {d M_x(t)} {d t} = \gamma ( \bold {M} (t) \times \bold {B} (t) ) _x - \frac {M_x(t)} {T_2}
    \frac {d M_y(t)} {d t} = \gamma ( \bold {M} (t) \times \bold {B} (t) ) _y - \frac {M_y(t)} {T_2}
    \frac {d M_z(t)} {d t} = \gamma ( \bold {M} (t) \times \bold {B} (t) ) _z - \frac {M_z(t) - M_0} {T_1}

where    is the gyromagnetic ratio and B(t) = (Bx(t), By(t), B0 +  Bz(t)) is the magnetic field experienced by the nuclei. The z component of the magnetic field B is sometimes composed of two terms:

    * one, B0, is constant in time,
    * the other one,  Bz(t), may be time dependent. It is present in magnetic resonance imaging and helps with the spatial decoding of the NMR signal.

M(t)   B(t) is the cross product of these two vectors. M0 is the steady state nuclear magnetization (that is, for example, when t ; it is in the z direction.

source: http://en.wikipedia.org/wiki/Bloch_equations

